import root from './header.module.scss';

const myList = ['Головна', 'Про мене', 'Сервіси', 'Портфоліо'];

console.log(
	myList.map((obj) => {
		<li>{obj.lol}</li>;
	})
);

const Header = () => {
	return (
		<div className={root}>
			<div className="logotyp">
				Web Deweloper <span>Kondratiev</span>
			</div>
			<ul className="myList">
				{myList.map((obj, index) => (
					<li key={index}>
						<a>{obj}</a>
					</li>
				))}
			</ul>
		</div>
	);
};

export default Header;
